def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

def solve(n):
    sum = 0
    for i in range(2, n+1):
        if n % i == 0 and is_prime(i):
            sum += i
    return sum

def solve(num):
    divisors = []
    for i in range(2, num+1):
        if num % i == 0:
            divisors.append(i)
    prime_divisors = []
    for j in divisors:
        is_prime = True
        for k in range(2, j):
            if j % k == 0:
                is_prime = False
                break
        if is_prime:
            prime_divisors.append(j)
    return sum(prime_divisors)

